export const Header = () => {
  return (
    <header className="header">
      <div className="header-bg">
        <div className="save-date">
          <h2 className="titles">Save the date</h2>
          <p className="titles">00/00/00</p>
        </div>
        <h1 className="titles">A day of joy</h1>
      </div>
    </header>
  );
};
